    <style>
        body {
            margin: 0;
            padding: 0;
        }

        .waiting-container {
            text-align: center;
            background: #ffffff;
            padding: 20px;
            border-radius: 8px;
            box-shadow: 0 0 15px rgba(0, 0, 0, 0.4);
            position: relative;
        }

        h1 {
            font-family: Arial, Helvetica, sans-serif;
            font-size: 1.5 rem;
            color: #7c50ff;
        }

        p {
            font-family: Arial, Helvetica, sans-serif;
            font-size: 1.2rem;
            color: var(--text-color);
        }

        .countdown {
            font-family: Arial, Helvetica, sans-serif;
            font-size: 1.5rem;
            font-weight: bold;
            color: #7c50ff;
            position: relative;
            display: inline-block;
            overflow: hidden;
            width: 4ch;

            animation:countdown {
                    {
                    $remainingTime
                }
            }

            s linear forwards
        }

        @keyframes  countdown {
            0% {
                content: attr(data-time)
            }

            100% {
                content: "0"
            }
        }

        .loader {
            position: absolute;
            top: 5%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 78px;
            height: 78px;
            border-radius: 50%;
            box-sizing: border-box;
            background: #fff;
            border: 8px solid #131a1d;
            overflow: hidden;
            z-index: 10;
        }

        .loader::after {
            content: '';
            position: absolute;
            left: 0;
            top: -50%;
            width: 100%;
            height: 100%;
            background: #7c50ff;
            z-index: 5;
            border-bottom: 8px solid #131a1d;
            box-sizing: border-box;
            animation: eyeShade 3s infinite;
        }

        .loader::before {
            content: '';
            position: absolute;
            left: 20px;
            bottom: 15px;
            width: 32px;
            height: 32px;
            background: #111;
            border-radius: 50%;
            animation: eyeMove 3s infinite;
        }

        @keyframes  eyeShade {
            0% {
                transform: translateY(0)
            }

            20% {
                transform: translateY(5px)
            }

            40%,
            50% {
                transform: translateY(-5px)
            }

            60% {
                transform: translateY(-8px)
            }

            75% {
                transform: translateY(5px)
            }

            100% {
                transform: translateY(10px)
            }
        }

        @keyframes  eyeMove {
            0% {
                transform: translate(0, 0)
            }

            20% {
                transform: translate(0, 5px)
            }

            40%,
            50% {
                transform: translate(0, -5px)
            }

            60% {
                transform: translate(-10px, -5px)
            }

            75% {
                transform: translate(-20px, 5px)
            }

            100% {
                transform: translate(0, 10px)
            }
        }

        .main {
            background-image: linear-gradient(to right, #404040 0%, #808080 100%);
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            position: relative;
            overflow-x: hidden;
        }

        .bg-custom {
            position: absolute;
            width: 100%;
            height: 100%;
            object-fit: cover;
            opacity: 0.8;
        }

        @media (max-width: 750px) {
            .bg-custom {
                width: 100%;
                height: auto;
            }
        }

        @media (max-width: 550px) {
            .waiting-container {
                margin: 20px;
            }

            h1 {
                font-size: 1.5rem;
                color: #404040;
                margin-top: 60px;
            }

            p {
                font-size: 1rem;
            }
        }

        .bg-card-second-dark {
            background-color: #000 !important;
        }

        p {
            color: #fff;
        }
    </style>
